import React, { Suspense, lazy } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import Hero from "./components/Hero"; // ✅ Added Hero Section
import Services from "./components/Services"; // ✅ Added Services Section
import Blog from "./components/Blog"; // ✅ Added Blog Section
import Compatibility from "./components/Compatibility";
import PremiumConsult from "./components/PremiumConsult";
import Astrologers from "./components/Astrologers";



// Lazy Load Components for Performance
const Home = lazy(() => import("./components/Home"));
const Horoscope = lazy(() => import("./components/Horoscope"));
const Consult = lazy(() => import("./components/Consult"));
const AIChat = lazy(() => import("./components/AIChat"));
const Palmistry = lazy(() => import("./components/Palmistry"));
const Payment = lazy(() => import("./components/Payment"));
const LiveSessions = lazy(() => import("./components/LiveSessions"));
const About = lazy(() => import("./components/About"));
const Contact = lazy(() => import("./components/Contact"));
const Dashboard = lazy(() => import("./components/Dashboard"));
const TarotCard = lazy(() => import("./components/TarotCard"));
const EPooja = lazy(() => import("./components/EPooja"));
const GemStore = lazy(() => import("./components/GemStore"));
const NotFound = lazy(() => import("./components/NotFound"));

// Loading Spinner
const Loading = () => (
  <div className="flex justify-center items-center h-screen bg-gray-100 dark:bg-gray-900 text-yellow-500">
    <div className="animate-spin rounded-full h-16 w-16 border-t-4 border-yellow-500"></div>
    <p className="mt-4 text-lg">Loading...</p>
  </div>
);

function App() {
  return (
    <Router>
      <Navbar />
      <Hero /> {/* ✅ Hero Section */}
      <Services /> {/* ✅ Astrology Services */}
      <Blog /> {/* ✅ Blog Section */}

      <Suspense fallback={<Loading />}>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/horoscope" element={<Horoscope />} />
          <Route path="/consult" element={<Consult />} />
          <Route path="/ai-chat" element={<AIChat />} />
          <Route path="/palmistry" element={<Palmistry />} />
          <Route path="/live-sessions" element={<LiveSessions />} />
          <Route path="/payment" element={<Payment />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/tarot-card" element={<TarotCard />} />
          <Route path="/e-pooja" element={<EPooja />} />
          <Route path="/gem-store" element={<GemStore />} />
          <Route path="*" element={<NotFound />} /> {/* ✅ 404 Page */}
          <Route path="/compatibility" element={<Compatibility />} />
          <Route path="/premium-consult" element={<PremiumConsult />} />
        </Routes>
      </Suspense>

      <Footer />
    </Router>
  );
}

export default App;
